import React from "react";

const CreateProfile = () => {
  return (
    <div className="m-auto xl:w-[54%] mt-24">
      <p className="text-redOne font-semibold md:text lg:text-5xl xl:text-[50px] pb-10">
        Create your Profile
      </p>

      <section className="bg-blueOne">
        <p>Why we need your BVN</p>
      </section>
    </div>
  );
};

export { CreateProfile };
